Plot:

Ujjain\'s Raja Vijay Singh presides over his region and rules it with his Maharani Swarnapati, and daughter Rajkumari Indumati. During the annual arena games a challenger by the name of Pitamber from out of this region challenges anyone to a duel with him, and the only one to accept it is Ramchandra alias Ramu. Ramu overcomes Pitamber and is felicitated by Indumati. Ramu falls head over heels in love with Indumati, and even saves her life when she is bitten by a snake. But the Raja does not approve of this match as he would like Indumati to marry a wealthy man, he accordingly instructs Ramu to get rich first before he can even consider marrying Indumati. It is then a magician named Mantrik comes to Ramu\'s aid, and shows him how to attain wealth. Ramu has to travel many miles, go underground into a deep dark cave, &amp; free a Goddess from a curse of living eternally as a crocodile...

